import React, { useState } from "react";

const AddProduct = () => {
  const [form, setForm] = useState({
    title: "",
    description: "",
    media: null,
    status: "draft",
    category: "",
    price: "",
    stock: "",
  });

  const handleChange = (e) => {
    const { name, value, type, files } = e.target;
    setForm((prev) => ({
      ...prev,
      [name]: type === "file" ? files[0] : value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Form submitted:", form);
  };

  return (
    <form
      onSubmit={handleSubmit}
      className="flex flex-col lg:flex-row gap-6 p-6 bg-gray-50 min-h-screen text-gray-800"
    >
      {/* Left Side */}
      <div className="flex-1 space-y-6">
        {/* Title */}
        <div className="bg-white p-4 rounded-xl shadow-sm">
          <label className="block text-sm font-medium mb-1">Title</label>
          <input
            type="text"
            name="title"
            value={form.title}
            onChange={handleChange}
            placeholder="Product title"
            className="w-full border border-gray-300 rounded-md p-2 focus:outline-none focus:ring-2 focus:ring-black"
          />
        </div>

        {/* Description */}
        <div className="bg-white p-4 rounded-xl shadow-sm">
          <label className="block text-sm font-medium mb-1">Description</label>
          <textarea
            name="description"
            value={form.description}
            onChange={handleChange}
            rows="5"
            className="w-full border border-gray-300 rounded-md p-2 focus:outline-none focus:ring-2 focus:ring-black"
            placeholder="Write product description..."
          ></textarea>
        </div>

        {/* Media */}
        <div className="bg-white p-4 rounded-xl shadow-sm">
          <label className="block text-sm font-medium mb-1">Media</label>
          <input
            type="file"
            name="media"
            onChange={handleChange}
            accept="image/*"
            className="mt-1 block w-full text-sm text-gray-500"
          />
        </div>

        {/* Submit Button */}
        <div className="pt-4">
          <button
            type="submit"
            className="w-full lg:w-auto bg-black text-white px-6 py-2 rounded-md hover:bg-gray-800 transition"
          >
            Add Product
          </button>
        </div>
      </div>

      {/* Right Side */}
      <div className="w-full lg:w-80 space-y-4">
        {/* Status */}
        <div className="bg-white p-4 rounded-xl shadow-sm">
          <label className="block text-sm font-medium mb-1">Status</label>
          <select
            name="status"
            value={form.status}
            onChange={handleChange}
            className="w-full border border-gray-300 rounded-md p-2 focus:outline-none focus:ring-2 focus:ring-black"
          >
            <option value="draft">Draft</option>
            <option value="active">Active</option>
          </select>
        </div>

        {/* Category */}
        <div className="bg-white p-4 rounded-xl shadow-sm">
          <label className="block text-sm font-medium mb-1">Category</label>
          <select
            name="category"
            value={form.category}
            onChange={handleChange}
            className="w-full border border-gray-300 rounded-md p-2 focus:outline-none focus:ring-2 focus:ring-black"
          >
            <option value="">Choose a category</option>
            <option value="electronics">Electronics</option>
            <option value="fashion">Fashion</option>
            <option value="beauty">Beauty</option>
            <option value="home">Home</option>
            <option value="gadgets">Gadgets</option>
          </select>
        </div>

        {/* Price */}
        <div className="bg-white p-4 rounded-xl shadow-sm">
          <label className="block text-sm font-medium mb-1">Price</label>
          <input
            type="number"
            name="price"
            value={form.price}
            onChange={handleChange}
            placeholder="$0.00"
            className="w-full border border-gray-300 rounded-md p-2 focus:outline-none focus:ring-2 focus:ring-black"
          />
        </div>

        {/* Stock */}
        <div className="bg-white p-4 rounded-xl shadow-sm">
          <label className="block text-sm font-medium mb-1">Stock</label>
          <input
            type="number"
            name="stock"
            value={form.stock}
            onChange={handleChange}
            placeholder="Stock quantity"
            className="w-full border border-gray-300 rounded-md p-2 focus:outline-none focus:ring-2 focus:ring-black"
          />
        </div>
      </div>
    </form>
  );
};

export default AddProduct;
